ivada por un administrador. Ahora ya puede acceder e idetificarte en %s usando el usuario %s y contraseña que eligió durante el proceso de registro.','/var/www/html/muserpol/language/es-ES/es-ES.com_users.ini'),(460,'COM_USERS_EMAIL_ACTIVATED_BY_ADMIN_ACTIVATION_SUBJECT','Cuenta activada para %s de %s','/var/www/html/muserpol/language/es-ES/es-ES.com_users.ini'),(461,'COM_USERS_EMAIL_PASSWORD_RESET_BODY','Hola,\\n\\nSe ha realizado una solicitud para restablecer su %s contraseña de la cuenta. Para restablecer la contraseña, necesita enviar este código de verificación, para que se pueda verificar que la solicitud es legítima.\\n\\nEl código de verificación es %s\\n\\nSeleccione la URL de abajo para poder proceder a restablecer su contraseña.\\n\\n %s \\n\\nGracias.','/var/www/html/muserpol/language/es-ES/es-ES.com_users.ini'),(462,'COM_USERS_EMAIL_PASSWORD_RESET_SUBJECT','Su %s solicitud de restablecimiento de contraseña','/var/www/html/muserpol/language/es-ES/es-ES.com_users.ini'),(463,'COM_USERS_EMAIL_REGISTERED_BODY','Hola %s,\\n\\nGracias por registrarse en %s.\\n\\nAhora ya puede acceder a %s usando el siguiente nombre de usuario y contraseña:\\n\\nUsuario: %s\\nContraseña: %s','/var/www/html/muserpol/language/es-ES/es-ES.com_users.ini'),(464,'COM_USERS_EMAIL_REGISTERED_BODY_NOPW','Hola %s,\\n\\nGracias por registrarse en %s.\\n\\nAhora ya puede acceder a %s usando el nombre de usuario y contraseña con los que se registró.','/var/www/html/muserpol/language/es-ES/es-ES.com_users.ini'),(465,'COM_USERS_EMAIL_REGISTERED_NOTIFICATION_TO_ADMIN_BODY','Hola, administrador, \\n\\nSe ha registrado un nuevo usuario \'%s\', con nombre de usuario \'%s\', en %s.','/var/www/html/muserpol/language/es-ES/es-ES.com_users.ini'),(466,'COM_USERS_EMAIL_REGISTERED_WITH_ACTIVATION_BODY','Hola, %s:\\n\\nGracias por registrarse en %s. Su cuenta ha sido creada y debe ser activada antes de que la pueda usar.\\nPara activar la cuenta, seleccione el siguiente enlace o copie y pegue la URL completa en su navegador:\\n%s \\n\\nTras la activación, ya podrá acceder a %s usando el siguiente usuario y contraseña:\\n\\nUsuario: %s\\nContraseña: %s','/var/www/html/muserpol/language/es-ES/es-ES.com_users.ini'),(467,'COM_USERS_EMAIL_REGISTERED_WITH_ACTIVATION_BODY_NOPW','Hola %s,\\n\\nGracias por registrarse en %s. Su cuenta se ha creado y deberá ser activada antes de que pueda usarla.\\nPara activar la cuenta, seleccione el siguiente enlace o cópielo en su navegador:\\n%s \\n\\nDespués de la activación puede identificarse en %s usando el siguiente nombre de usuario junto a la contraseña que introdujo durante el proceso de instalación:\\n\\nUsuario: %s','/var/www/html/muserpol/language/es-ES/es-ES.com_users.ini'),(468,'COM_USERS_EMAIL_REGISTERED_WITH_ADMIN_ACTIVATION_BODY','Hola, %s:\\n\\nGracias por registrarte en %s. Su cuenta ha sido creada y necesita ser verificada antes de que pueda usarla.\\nPara activar la cuenta, seleccione el siguiente enlace o copie y pegue la URL completa en su navegador:\\n %s \\n\\nDespués de la verificación un administrador será advertido para que active la cuenta. Recibirá una confirmación cuando se haya hecho.\\nUna vez que la cuenta se haya activado, podrá acceder a %s usando el siguiente usuario y contraseña:\\n\\nUsuario: %s\\nContraseña: %s','/var/www/html/muserpol/language/es-ES/es-ES.com_users.ini'),(469,'COM_USERS_EMAIL_REGISTERED_WITH_ADMIN_ACTIVATION_BODY_NOPW','Hola %s,\\n\\nGracias por registrarse en %s. Su cuenta ha sido creada y deberá ser verificada antes de que pueda usarla.\\nPara verificar la cuenta, seleccione el siguiente enlace o cópielo en su navegador:\\n %s \\n\\nDespués de que usted haya verificado la cuenta, un administrador recibirá una notificación para la activación de la cuenta. Cuando el administrador la haya activado, usted recibirá una confirmación.\\nDespués de esto, usted podrá identificarse en to %s usando el siguiente nombre de usuario junto a la contraseña que introdujo durante el proceso de r