s permisos de grupo.','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1732,'JLIB_RULES_NOTICE_RECALCULATE_GROUP_CHILDS_PERMISSIONS','Permisos cambiados en un grupo que contiene subgrupos. Guarde o recargue para poder recalcular los permisos de los subgrupos.','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1733,'JLIB_RULES_REQUEST_FAILURE','Fallo enviando los datos al servidor.','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1734,'JLIB_RULES_SAVE_BEFORE_CHANGE_PERMISSIONS','Por favor, guarde antes de cambiar los permisos.','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1735,'JLIB_RULES_SELECT_ALLOW_DENY_GROUP','Permitir o denegar %s para los usuarios en el grupo %s','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1736,'JLIB_RULES_SELECT_SETTING','Seleccionar la nueva configuración','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1737,'JLIB_RULES_SETTING_NOTES','Si cambia la configuración, las modificaciones se aplicarán en este grupo y en todos sus subgrupos, componentes y contenido. Note que:<br /><em><strong>Denegado</strong></em> sobrescribirá cualquier configuración heredada, así como la configuración asignada desde cualquier subgrupo, componente, o contenido. En caso de que se produzcan conflictos con la configuración, <em><strong>Denegar</strong></em> tomará preferencia. <em><strong>Sin asignar</strong></em> es equivalente a <em><strong>Denegado</strong></em> pero con la diferencia que permite realizar cambios en el estado de los permisos dentro de los subgrupos, componentes y contenido.','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1738,'JLIB_RULES_SETTING_NOTES_ITEM','Si cambia la configuración, las modificaciones se aplicarán en este elemento. Note que:<br /><em><strong>Heredado</strong></em> quiere decir que, para determinar el estado del permiso, se tendrá en cuenta lo que haya asignado desde la configuración global, desde los grupos de nivel superior y desde la categoría.<br /><em><strong>Denegado</strong></em> quiere decir que da igual como esté configurado el estado de los permisos sobre esa acción desde la configuración global, o desde los grupos de nivel superior, o desde la categoría; es decir, al grupo al que le cambie el estado del permiso a \'Denegado\' desde este apartado, no podrá realizar esa acción sobre este elemento (incluyendo a todos sus subgrupos, si tuviera).<br /><em><strong>Permitido</strong></em> quiere decir que el grupo al que le cambie el estado de la acción a \'Permitido\' desde aquí, podrá realizar esa acción sobre este elemento (pero si esta configuración entra en conflicto con lo asignado desde la configuración global, o con lo asignado en los grupos de nivel superior, o con lo asignado desde la categoría, la configuración que aplique desde aquí no tendrá efecto, y el conflicto será indicado con un <em><strong>No permitido (heredado)</strong></em> debajo del estado de configuración calculada).','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1739,'JLIB_RULES_SETTINGS_DESC','Gestione la configuración de privilegios para los grupos de usuarios de más abajo. Revise las notas de la parte inferior.','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1740,'JLIB_STEMMER_INVALID_STEMMER','Tipo de analizador lingüístico inválido %s','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1741,'JLIB_UNKNOWN','Desconocido','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1742,'JLIB_UPDATER_ERROR_COLLECTION_FOPEN','La directiva de PHP \'allow_url_fopen\' está deshabilitado. Debe estar habilitada para que funcione el instalador.','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1743,'JLIB_UPDATER_ERROR_COLLECTION_OPEN_URL','Update: :Collection: No se ha podido abrir %s','/var/www/html/muserpol/language/es-ES/es-ES.lib_joomla.ini'),(1744,'JLIB_UPDATER_ERROR_COLLECTION_PARSE_URL','Update: :Collection: No se ha podido analizar %s','/v