el idioma pero en mayúsculas. Por ejemplo: EN para el inglés, FR para francés.','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2134,'MOD_LANGUAGES_FIELD_FULL_NAME_LABEL','Nombres completos del idioma','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2135,'MOD_LANGUAGES_FIELD_HEADER_DESC','Este es el texto o HTML que se muestra después del selector de idioma','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2136,'MOD_LANGUAGES_FIELD_HEADER_LABEL','Texto inicial','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2137,'MOD_LANGUAGES_FIELD_INLINE_DESC','Predeterminadamente está asignado en \'Sí\', por ejemplo, para mostrarse en sentido horizontal.','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2138,'MOD_LANGUAGES_FIELD_INLINE_LABEL','Mostrar horizontalmente','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2139,'MOD_LANGUAGES_FIELD_LINEHEIGHT_DESC','Si se configura en \'Sí\', se decrementará la altura de línea cuando se usen banderas.','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2140,'MOD_LANGUAGES_FIELD_LINEHEIGHT_LABEL','Alto de línea','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2141,'MOD_LANGUAGES_FIELD_MODULE_LAYOUT_DESC','Use una vista para el módulo suministrado o sobrescríbala en la platilla predeterminada. \'Predeterminado\' muestra las banderas del idioma.','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2142,'MOD_LANGUAGES_FIELD_USEIMAGE_DESC','Use una descripción para la imagen de la bandera','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2143,'MOD_LANGUAGES_FIELD_USEIMAGE_LABEL','Usar la imagen de banderas','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2144,'MOD_LANGUAGES_OPTION_DEFAULT_LANGUAGE','Predeterminado','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2145,'MOD_LANGUAGES_SPACERDROP_LABEL','<u>Si \'Usar la lista de selección\' está configurado en \'Sí\', <br />Las opciones de visionado siguientes serán ignoradas</u>','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2146,'MOD_LANGUAGES_SPACERNAME_LABEL','<u>Si \'Usar imágenes de banderas\' está configurado en \'Sí\', <br />Las opciones de visionado siguientes serán ignoradas</u>','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2147,'MOD_LANGUAGES_SPACER_USENAME_LABEL','<u>Como \'Usar lista de selección\' y \'Usar imágenes de banderas\' se han configurado en \'No\',<br /> el intercambiador mostrará nombres de idioma.</u>','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2148,'MOD_LANGUAGES_XML_DESCRIPTION','Este módulo muestra una lista de idiomas de contenido disponibles (tantos como los definidos y publicados desde el gestor de idiomas) para poder seleccionar entre ellos cuando uno quiere usar Joomla! como un sitio de múltiples idiomas. <br />--El plugin \'Sistema - Filtrar idioma\' tiene que estar habilitado.--<br /> cuando se seleccionan idiomas, el módulo redirecciona hacia la página definida para usar ese idioma seleccionado. A partir de entonces, solo se mostrará contenido configurado para ese idioma.<br />Si el plugin <strong>\'Sistema - Filtrar idioma\'</strong> no está habilitado, puede ocasionar resultados inesperados.<br /><strong>Método:</strong><br />1. Abra el gestor de idiomas y asegúrese de que los idiomas de contenido están publicados y tienen un código de idioma para la URL, así como el prefijo para la imagen usada en el módulo selector del idioma.<br />2. Cree una página de inicio asignando un idioma a un elemento, y defínalo como predeterminado de la página de inicio para cada contenido publicado en un idioma. <br /> 3. A partir de ahí, usted puede asignar un idioma a cualquier artículo, categoría, módulo, canal electrónico, o enlace web de Joomla!.<br /> 4. Asegúrese de que tanto el módulo está publicado y el plugin habilitado.<br /> 5. Cuando se usen elementos asociados, asegúrese de que el módulo se muestra en las páginas que corresponda. <br />6. El modo en el que se mostrarán las banderas o el nombre de los idiomas se define según el orden establecido desde el \'Gestor de idiomas - Idiomas del contenido\'','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.ini'),(2149,'MOD_LANGUAGES','Selector de idioma','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.sys.ini'),(2150,'MOD_LANGUAGES_XML_DESCRIPTION','Este módulo muestra una lista de los idiomas del contenido disponibles (tantos como haya definidos y publicados desde la pestaña \'Idiomas del contenido\' que hay en el \'Gestor de idiomas\') para poder cambiar entre ellos cuando uno lo desee y así poder usar Joomla! como un sitio de múltiples idiomas.<br />--El plugin \'Sistema - Filtro del idioma\' tiene que estar habilitado.--<br />Cuando se cambia de idioma y el elemento a mostrar en la página no tiene asociación con otro elemento, el módulo redirigirá a la página de inicio del idioma seleccionado.<br />En otro caso, es decir, si el parámetro está configurado por el plugin del filtro de idiomas, se redirigirá al elemento asociado para el idioma seleccionado. Después de esto, la navegación será la definida para ese idioma.<br />Si el plugin <strong>\'Sistema - Filtro del idioma\'</strong> está deshabilitado podría ocasionar resultados no deseados.<br /><strong>Método:</strong><br />1. Abrir por la pestaña \'Idiomas del contenido\' que hay en el gestor de idiomas y asegúrese de que los idiomas que desea usar están publicados y tienen un código del idioma para la URL así como un prefijo para la imagen a usar desde el módulo.<br />2. Crear una página de inicio para poder asignar un idioma al elemento del menú y definiéndolo como página de inicio predeterminada para cada idioma del contenido que tenga publicado. <br /> 3. Después de eso, puede asignar un idioma a cada artículo, categoría, módulo, canal electrónico o enlace web de Joomla.<br /> 4. Asegúrese de que el módulo está publicado y el plugin habilitado.<br /> 5. Cuando esté usando elementos asociados, asegúrese de que el módulo se esté mostrando en las correspondientes páginas.<br />6. La manera en la que se muestran las banderas o nombres del idioma se define con la ordenación de los elementos disponible desde el \'Gestor de idiomas -Idiomas del contenido\'.<br ><br >Si se publica este módulo, también se recomienda publicar el módulo de la administración \'Estado multiidioma\'.','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.sys.ini'),(2151,'MOD_LANGUAGES_LAYOUT_DEFAULT','Predeterminado','/var/www/html/muserpol/language/es-ES/es-ES.mod_languages.sys.ini'),(2152,'MOD_LOGIN','Datos de acceso','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2153,'MOD_LOGIN_FIELD_GREETING_DESC','Mostrar u ocultar el texto breve de bienvenida.','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2154,'MOD_LOGIN_FIELD_GREETING_LABEL','Mostrar bienvenida','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2155,'MOD_LOGIN_FIELD_LOGIN_REDIRECTURL_DESC','Seleccione o cree la página a la que será redirigido el usuario tras identificarse correctamente. Predeterminadamente mantendrá la misma página.','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2156,'MOD_LOGIN_FIELD_LOGIN_REDIRECTURL_LABEL','Redirección de conexión','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2157,'MOD_LOGIN_FIELD_LOGOUT_REDIRECTURL_DESC','Seleccione o cree la página a la que será redirigido el usuario tras desconectarse. Predeterminadamente mantendrá la misma página.','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2158,'MOD_LOGIN_FIELD_LOGOUT_REDIRECTURL_LABEL','Redirección de desconexión','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2159,'MOD_LOGIN_FIELD_NAME_DESC','Muestra el nombre completo o el usuario tras identificarse','/var/www/html/muserpol/language/es-ES/es-ES.mod_login.ini'),(2160,'MOD_LOGIN_FIELD_NAME_LA